import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme)=>({
  container:{
   backgroundColor:theme.palette.background.paper,
   padding:theme.spacing(8,0,6)
  },
  icon:{
    marginRight: "20px"
  },
  buttons:{
    marginTop:"40px"
  },
  cardGrid:{
  padding:"20px"
  },
  card:{
    height:"100%",
    display:"flex",
    flexDirection:"coloumn"
  },
  cardMedia:{
    paddingTop:"56.25%"
    
  },
  cardContent:{
    flexGrow:1
  },
  bothButtons:{
    display:'flex',
    float:'right',
    marginTop:'10px',
    marginRight:'10px',
  },
  signupBtn:{
    margin:'10px'
  },
  loginBtn:{
    margin:'10px',
    backgroundColor:'black',
    color:'white'
  },
  partner:{
    marginTop:'15px'
  }
}));
export  default useStyles;
